  if (!iResReqInfo.hasNext()) {
    if (!iCapMap.hasNext()) {
      if (!iExecTypeMap.hasNext()) {
        iExecTypeMap = iLocMap.next().values().iterator();
      }
      iCapMap = iExecTypeMap.next().values().iterator();
    }
    iResReqInfo = iCapMap.next().values().iterator();
  }
  return iResReqInfo.next();
}
